 We can use React Context to create a global state for the Tooltip component.

## Create a Tooltip in NextJS using React Context

### Step 1: Create a Tooltip Context

Create a TooltipContext.js file in the components folder and add the following code.
```
import React, { createContext, useState } from "react";

export const TooltipContext = createContext();

export const TooltipProvider = ({ children }) => {
  const [tooltip, setTooltip] = useState(null);

  return (
    <TooltipContext.Provider value={{ tooltip, setTooltip }}>
      {children}
    </TooltipContext.Provider>
  );
};
```
### Step 2: Create a Tooltip Component

Create a Tooltip.js file in the components folder and add the following code.
```
import React, { useContext } from "react";
import { TooltipContext } from "./TooltipContext";

const Tooltip = ({ children, tooltip }) => {
  const { setTooltip } = useContext(TooltipContext);

  return (
    <div className="tooltip">
      <div className="tooltip__content">{tooltip}</div>
      <div className="tooltip__trigger">{children}</div>
    </div>
  );
};

export default Tooltip;
```
### Step 3: Create a Tooltip Trigger Component

Create a TooltipTrigger.js file in the components folder and add the following code.
```
import React, { useContext } from "react";
import { TooltipContext } from "./TooltipContext";

const TooltipTrigger = ({ children, tooltip }) => {
  const { setTooltip } = useContext(TooltipContext);

  return (
    <div
      className="tooltip__trigger"
      onMouseEnter={() => setTooltip(tooltip)}
      onMouseLeave={() => setTooltip(null)}
    >
      {children}
    </div>
  );
};

export default TooltipTrigger;
```
### Step 4: Create a TooltipProvider Component

Create a TooltipProvider.js file in the components folder and add the following code.
```
import React, { useContext } from "react";
import { TooltipContext } from "./TooltipContext";

const TooltipProvider = ({ children }) => {
  const { tooltip, setTooltip } = useContext(TooltipContext);

  return (
    <div className="tooltip__container">
      <TooltipTrigger tooltip={tooltip}>{children}</TooltipTrigger>
      <Tooltip tooltip={tooltip}>{children}</Tooltip>
    </div>
  );
};

export default TooltipProvider;
```
### Step 5: Use the Tooltip Component

Now we can use the Tooltip component in our application. For example, we can create a Tooltip component in the App.js file.
```
import React from "react";
import { TooltipProvider } from "../components/TooltipProvider";

const App = () => {
  return (
    <TooltipProvider>
      <div className="app">
        <TooltipTrigger tooltip="Tooltip 1">
          <button>Tooltip 1</button>
        </TooltipTrigger>
        <TooltipTrigger tooltip="Tooltip 2">
          <button>Tooltip 2</button>
        </TooltipTrigger>
        <TooltipTrigger tooltip="Tooltip 3">
          <button>Tooltip 3</button>
        </TooltipTrigger>
      </div>
    </TooltipProvider>
  );
};

export default App;
```
